import React from "react";
import Search from "../search/Search";
import { FaRegTrashAlt } from "../../../node_modules/react-icons/fa";

const Header = (props) => {
  return (
    <header style={styles.header}>
      <h1 style={styles.h1}>{props.pgTitle}</h1>
      <Search />
      <FaRegTrashAlt />
      <h5>I ma here</h5>
    </header>
  );
};

export default Header;

const styles = {
  header: {
    position: "fixed",
    display: "flex",
    flextDirection: "row",
    backgroundColor: "#ccc",
    justifyContent: "space-between",
    width: "100%",
    height: "5rem",
  },
  h1: {
    fontSize: "1.5rem",
    color: "#000000",
    marginLeft: "1rem",
  },
};
